<template>
	<div class="full-content">
		<div class="bg-image">
			<Header />

			<div class="content bg">
				<v-container>
					<div class="tools offset-top">
						<Sidebar />

						<div class="pt-8 grid">
							<div class="image-generate">
								<h3 class="title box mb-3">Image Generator</h3>

								<label class="field field-select">
									<div class="text">Mode</div>
									<select v-model="form.type">
										<option value="image">Simple image</option>
										<option value="qr_code">QR Code</option>
									</select>
								</label>

								<v-form action="#" method="GET" class="mt-7 form-generate" ref="form"
									@submit.prevent="sendForm">

									<label class="field field-select" v-if="form.type === 'qr_code'">
										<div class="text">QR code strength</div>
										<p style="color:white;">{{ form.qr_code_strength }}</p>
										<Vue3Slider v-model="form.qr_code_strength" alwaysShowHandle="1" color="#FB278D"
											track-color="#FEFEFE" />
									</label>

									<label class="field mt-9" v-if="form.type === 'qr_code'">
										<div class="text">Link for QR Code</div>
										<input v-model="form.url" placeholder="https://test.test/" />
									</label>
									<label class="field mt-9">
										<div class="text">What should AI draw?</div>
										<textarea placeholder="Bird, colorful, realistic, high detailed"
											v-model="form.prompt"></textarea>
									</label>
									<input type="submit" class="btn" :class="{ preloader: generate }" value="Generate"
										ref="submit">
								</v-form>
							</div>

							<div class="image-results" v-if="generatedImages.length">
								<h3 class="title box mb-3">Images:</h3>
								<div v-for="generatedImage, index in generatedImagesList" :key="index">
									<div v-if="generatedImage.status === 'generating' || generatedImage.status === 'completed'"
										class="row mt-10">
										<div v-for="(imagePart, index) in generatedImage.imageParts" :key="index"
											class="item">
											<div class="image">
												<img :src="imagePart[0]" alt="">
											</div>
											<div class="group">
												<a @click.prevent="openImageInNewTab(imagePart[0])" target="_blank"
													class="download">
													<img src="@/assets/icons/download.svg" alt="">
												</a>
											</div>
										</div>
									</div>
								</div>
							</div>
						</div>
					</div>
				</v-container>
			</div>

			<Footer />
		</div>
	</div>
</template>

<script>
import Header from '@/components/Header';
import Footer from '@/components/Footer';
import Sidebar from '@/components/Sidebar';
import axios from 'axios';
import store from '@/store';
import * as qrcode from 'qrcode';
import Vue3Slider from "vue3-slider"

export default {
	components: {
		Header,
		Footer,
		Sidebar,
		Vue3Slider,
	},
	data() {
		return {
			generatedImages: [],
			left_count: null,
			imagesGeneration: {},
			sessionHash: null,
			qrCodeMask: "data:image/png;base64,",
			qrCode: null,
			select: [
				'Logo',
				'Flyers',
				'Instagram Post',
				'Video Thumbnails',
				'Pamphlets',
				'Proposals'
			],
			form: {
				type: 'image',
				prompt: null,
				url: null,
				qr_code_strength: 70,
			},
			generate: false
		}
	},
	computed: {
		limits() {
			const limits = store.getters.getAccountLimit(this.$route.name + 'Api') || {};
			this.left_count = limits.leftCount ?? null;
			return limits;
		},
		generatedImagesList() {
			return [...this.generatedImages].reverse();
		}
	},
	methods: {
		openImageInNewTab(src) {
			var image = new Image();
			image.src = src;

			var w = window.open("");
			w.document.write(image.outerHTML);
		},
		async sendTask(initMessage, afterSendData) {
			return new Promise((async r => {
				store.commit('SOCKET_SET_MESSAGE_LISTENER', (message) => {
					if (message.msg === 'send_hash') {
						initMessage();
					}

					if (message.msg === 'send_data') {
						afterSendData();
					}

					if (message.msg === 'process_completed') {
						r();
					}
				});

				await store.dispatch('connectSocket')
			}))
		},
		async sendForm() {
			this.form.prompt = (this.form.prompt || '').trim();
			this.form.url = (this.form.url || '').trim();

			if (!this.form.prompt) {
				return this.$toast.error('Prompt is required!');
			}

			if (this.form.type === 'qr_code' && !this.form.url) {
				return this.$toast.error('Url is required!');
			}

			if (this.form.prompt.length > 75) {
				return this.$toast.error('Prompt must have less than 75 chars!');
			}

			this.sessionHash = (+new Date()).toString();

			if (this.generate) {
				return;
			}

			this.generate = true;

			const image = {
				imageParts: [],
				status: 'created',
			}

			this.imagesGeneration = image;
			this.generatedImages.push(this.imagesGeneration);

			await this.sendTask(
				() => {
					return store.dispatch('emitSocketMessage', {
						"fn_index": 1114,
						"session_hash": this.sessionHash
					})
				},
				() => {
					return store.dispatch('emitSocketMessage', {
						"data": [
							"seekyou_momo/seekyou_momo.safetensors"
						],
						"event_data": null,
						"fn_index": 1114,
						"session_hash": this.sessionHash
					});
				}
			);

			if (this.form.type === 'qr_code') {
				let QRbase64 = await new Promise((resolve, reject) => {
					qrcode.toDataURL(this.form.url, function (err, code) {
						if (err) {
							reject(reject);
							return;
						}
						resolve(code);
					});
				});

				this.qrCode = QRbase64;


				await this.sendTask(
					() => {
						return store.dispatch('emitSocketMessage', {
							"fn_index": 429,
							"session_hash": this.sessionHash
						})
					},
					() => {
						return store.dispatch('emitSocketMessage', {
							"data": [
								null,
								null,
								null,
								false,
								false,
								null,
								true,
								"inpaint_global_harmonious",
								"controlnet11Models_depth [4b72d323]",
								1,
								{
									"image": this.qrCode,
									"mask": this.qrCodeMask
								},
								"Crop and Resize",
								false,
								-1,
								-1,
								-1,
								0,
								1,
								false,
								"Balanced"
							],
							"event_data": null,
							"fn_index": 429,
							"session_hash": this.sessionHash
						});
					}
				);

				await this.sendTask(
					() => {
						return store.dispatch('emitSocketMessage', {
							"fn_index": 468,
							"session_hash": this.sessionHash
						})
					},
					() => {
						return store.dispatch('emitSocketMessage', {
							"data": [
								null,
								null,
								null,
								false,
								false,
								null,
								true,
								"inpaint_global_harmonious",
								"controlnet11Models_depth [4b72d323]",
								0.5,
								{
									"image": this.qrCode,
									"mask": this.qrCodeMask
								},
								"Crop and Resize",
								false,
								-1,
								-1,
								-1,
								0.35,
								+(this.form.qr_code_strength / 100).toFixed(2),
								false,
								"Balanced"
							],
							"event_data": null,
							"fn_index": 468,
							"session_hash": this.sessionHash
						})
					}
				);
			}

			await this.sendTask(
				() => {
					return store.dispatch('emitSocketMessage', {
						"fn_index": 567,
						"session_hash": this.sessionHash
					})
				},
				() => {
					store.commit('SOCKET_SET_MESSAGE_LISTENER', (message) => {
						if (message.msg === 'process_completed') {
							const finImage = message?.output?.data?.[0]?.[0]?.name;
							if (finImage) {
								const url = `http://generate.kaizencloud.net:1111/file=${finImage}`;
								this.imagesGeneration.imageParts = [[url]];
								this.imagesGeneration.status = 'completed';

								this.generatedImages = [...this.generatedImages];
							}

							this.generate = false;
						}
					})
					return store.dispatch('emitSocketMessage', {
						"data": [
							"task(e6uql44nukik7d4)",
							0,
							this.form.prompt,
							"bad_prompt_version2-neg,badhandv4,(worst quality, low quality:1.3),(inaccurate limb:1.2),(fewer legs),(fewer arms),(extra legs),(extra arms),(cross eyes),bad_pictures,(bad anatomy),(skin blemishes),",
							[],
							this.form.type === 'qr_code' ? this.qrCode : null,
							null,
							null,
							null,
							null,
							null,
							null,
							20,
							"DPM++ 2M Karras",
							4,
							0,
							"original",
							false,
							false,
							1,
							1,
							7,
							1.5,
							Math.min(0.85 * ((100 - this.form.qr_code_strength / 2) / 65), 1),
							-1,
							-1,
							0,
							0,
							0,
							false,
							null,
							512,
							512,
							1,
							"Just resize",
							"Whole picture",
							32,
							"Inpaint masked",
							"",
							"",
							"",
							[],
							"None",
							false,
							"",
							0,
							false,
							false,
							"LoRA",
							"None",
							1,
							1,
							"LoRA",
							"None",
							1,
							1,
							"LoRA",
							"None",
							1,
							1,
							"LoRA",
							"None",
							1,
							1,
							"LoRA",
							"None",
							1,
							1,
							null,
							"Refresh models",
							null,
							null,
							null,
							false,
							"",
							0.5,
							true,
							false,
							"",
							"Lerp",
							false,
							null,
							false,
							"0",
							"/home/zorin-pc/foss/automatic1111/stable-diffusion-webui/models/roop/inswapper_128.onnx",
							"CodeFormer",
							1,
							"",
							1,
							1,
							false,
							true,
							"<ul>\n<li><code>CFG Scale</code> should be 2 or lower.</li>\n</ul>\n",
							true,
							true,
							"",
							"",
							true,
							50,
							true,
							1,
							0,
							false,
							4,
							0.5,
							"Linear",
							"None",
							"<p style=\"margin-bottom:0.75em\">Recommended settings: Sampling Steps: 80-100, Sampler: Euler a, Denoising strength: 0.8</p>",
							128,
							8,
							[
								"left",
								"right",
								"up",
								"down"
							],
							1,
							0.05,
							128,
							4,
							"fill",
							[
								"left",
								"right",
								"up",
								"down"
							],
							false,
							false,
							"positive",
							"comma",
							0,
							false,
							false,
							"",
							"<p style=\"margin-bottom:0.75em\">Will upscale the image by the selected scale factor; use width and height sliders to set tile size</p>",
							64,
							"None",
							2,
							"Seed",
							"",
							[],
							"Nothing",
							"",
							[],
							"Nothing",
							"",
							[],
							true,
							false,
							false,
							false,
							0,
							5,
							"all",
							"all",
							"all",
							"",
							"",
							"",
							"1",
							"none",
							false,
							"",
